import React from 'react';
import { StyleSheet, Image,Text, Dimensions,TouchableOpacity,TextInput,View, ActivityIndicator, ScrollView } from 'react-native';
import Canvas, {Image as CanvasImage} from 'react-native-canvas';
import RNFetchBlob from 'react-native-fetch-blob'
import Moment from 'moment';
import { Rating } from 'react-native-elements';
import ImagePicker from 'react-native-image-picker'
import ImageResizer from 'react-native-image-resizer';

const options = {
  title: 'Select image of your avatar',
  cameraType: 'back',
  mediaType: 'photo',
  maxWidth: 1000,
  maxHeight: 1000,
  aspectX: 2,
  aspectY: 1,
  quality: 1,
  angle: 0,
  allowsEditing: false,
  noData: false,
  storageOptions: {
    skipBackup: true,
    path: 'images',
  },
}
var spacesBetweenLines = 11;
var screenWidth = Dimensions.get('window').width
var screenHeight = Dimensions.get('window').height
export default class App extends React.Component {

  state =  {
    foodName : "",
    resturantAddress : "",
    userReview : "",
    givenRatings : "",
    showImage:false,
    avatar: null,
    fileName:'',
    bgImageSrc :  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-XVlVmRd4QrtD2DMzeDBVpkR-QSev-6Cm_FMivWKmFBosnByK",
    profileImage : "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-XVlVmRd4QrtD2DMzeDBVpkR-QSev-6Cm_FMivWKmFBosnByK",
    imageSelect : 0,
    txtArray : []

  }
  constructor(props){
    super(props);
    this.ratingCompleted = this.ratingCompleted.bind(this);
    this._pickImage = this._pickImage.bind(this);
    // this.onReset = this.onReset.bind(this);
  }

  addBackgroundImage = function(url, canvas) {
    return this.loadImage({
      src: url, x: 0, y: 0,
      width: 300, height: 300,
      canvas: canvas,
      squareImage: true
    });

  }


  addOpaqueBg = (x, y, width, height, ctx) => {
    // ctx.globalAlpha = 0.2;
    ctx.fillStyle = 'rgba(0,0,0,0.2)';
    ctx.fillRect(x, y, width, height);
  }

  addRatings = (anchorLength,givenRatings, yellowStar, grayStar, canvas) => {
    const promises = [];
    for (let i = 0; i < 5; i++) {
      const ratingStar = i < givenRatings ? yellowStar : grayStar;
      let x = 60;
      const y = 222;
      const height = width = 15;

      promises.push(this.loadImage({
        src: ratingStar, x: (x + i * width), y: y-(anchorLength),
        width: width, height: height,
        canvas: canvas
      }));
    }
    return promises;
  }

  addReviews = async(txtArray, ctx) => {
    var length = txtArray.length;
    for (let i = 0; i < length; i++) {
      this.addText(ctx, {
        font: '11px Roboto',
        fill: 'white',
        text: txtArray[i],
        x: 60, y: ((250 + spacesBetweenLines * i))-(length+(length*(length/2))),
      });
    }
  }


  profilePlaceholder = (x, y, r, ctx) => {
    // ctx.beginPath();
    ctx.arc(x,y,r,0,2*Math.PI);
    ctx.lineWidth = 1;
    ctx.strokeStyle = "#00CDBE";
    ctx.stroke();
    ctx.clip();
    // ctx.closePath();
    // ctx.restore();
  }
  getTopTransparency(){
    return 'data:image/png;base64,'
  }
  getBottomTranparency(){
    return 'data:image/png;base64,'
  }
  getYellowStar(){
    return 'data:image/png;base64,';
  }

  getGrayStar(){
    return 'data:image/png;base64,';
  }

  _pickImage = async () => {
    ImagePicker.showImagePicker(options, response => {
      console.log(response)
      if (!response.didCancel && !response.error) {
        const source = { uri: response.uri }
        Image.getSize(response.uri, (width, height) => {
          if (width > height){
            var savedThis = this;
            var xhr = new XMLHttpRequest();
            xhr.open("GET", response.uri , true);
            xhr.responseType = "blob";
            xhr.onload = function (e) {

              var reader = new FileReader();
              reader.onload = function(event) {
              var res = event.target.result;
              if(savedThis.state.imageSelect==1){
                savedThis.setState({bgImageSrc:res})
              }else if(savedThis.state.imageSelect==2){
                savedThis.setState({profileImage:res})
              }
            }
            var file = this.response;
            reader.readAsDataURL(file)
            };
            xhr.send();
          }else if(width < height){
            ImageResizer.createResizedImage(response.uri, height, width, 'JPEG', 100, 0).then((response) => {
              var savedThis = this;
              var xhr = new XMLHttpRequest();
              xhr.open("GET", response.uri , true);
              xhr.responseType = "blob";
              xhr.onload = function (e) {

                var reader = new FileReader();
                reader.onload = function(event) {
                var res = event.target.result;
                if(savedThis.state.imageSelect==1){
                  savedThis.setState({bgImageSrc:res})
                }else if(savedThis.state.imageSelect==2){
                  savedThis.setState({profileImage:res})
                }
              }
              var file = this.response;
              reader.readAsDataURL(file)
              };
              xhr.send()
            }).catch((err) => {

            });
          }
        });
      }else{
        console.log(response.error);
      }
    })
  }
  splitArray(userReview){
    while(userReview.length > 50){
        var pos = userReview.substring(0, 45).lastIndexOf(' ');
        pos = pos <= 0 ? 50 : pos;
        this.state.txtArray.push(userReview.substring(0, pos));
        var i = userReview.indexOf(' ', pos)+1;
        if(i < pos || i > pos+45)
            i = pos;
        userReview = userReview.substring(i);
    }
    this.state.txtArray.push(userReview);
    return this.state.txtArray;
  }

  handleCanvas = async (canvas) => {
    const foodName = this.state.foodName;
    const resturantAddress = this.state.resturantAddress;
    const userReview = this.state.userReview;
    var txtArray = this.splitArray(userReview);
    var length = txtArray.length;
    var anchorLength = length+(length*(length/2));
    const date = Moment(new Date()).format('D MMMM YYYY');
    const yellowStar = this.getYellowStar();
    const grayStar = this.getGrayStar();
    const profileImage = this.state.profileImage;
    const companyLogo = 'data:image/png;base64,';
    const givenRatings = this.state.givenRatings;
    const bgImageSrc = this.state.bgImageSrc;
    const topTransparency = this.getTopTransparency();
    const bottomTranparency = this.getBottomTranparency();
    let imageLoadingPromises = [];

    /*
     * objects have been added on canvas with dimensions 300x300
     * scale to get desired dimensions
     */
    window.devicePixelRatio = 1;
    const scaleX = 1.2;
    const scaleY = 1.2;

    canvas.width =  300 * scaleX;
    canvas.height =  300 * scaleY;
    const ctx = canvas.getContext('2d');
    ctx.scale(scaleX, scaleY);
    console.log(window.devicePixelRatio, ctx.height);
    await this.addBackgroundImage(bgImageSrc, canvas);

    await this.loadImage({
      src: topTransparency, x: 0, y: 0,
      width: 300, height: 100,
      canvas: canvas
    });

    await this.loadImage({
      src: bottomTranparency, x: 0, y:215-((anchorLength+50)+(anchorLength*(anchorLength/2))),
      width: 300, height: 85+((anchorLength+50)+(anchorLength*(anchorLength/2))),
      canvas: canvas
    });

    await this.loadImage({
      src: profileImage, x: 15, y: 230-anchorLength,
      width: 40, height: 40,
      canvas: canvas ,
      squareImage :true,
      clip: true,
      anchorLength: anchorLength
    });

    this.addText(ctx, {
      font: 'bold 15px Roboto',
      fill: 'white',
      text: foodName,
      x: 15, y: 22,
    });

    this.addText(ctx, {
      font: '12px Roboto',
      fill: 'white',
      text: resturantAddress,
      x: 15, y: 37,
    });

    // this.addOpaqueBg(0,215-anchorLength  ,300 ,85+anchorLength , ctx);



    imageLoadingPromises = this.addRatings(anchorLength,givenRatings, yellowStar, grayStar, canvas).concat(imageLoadingPromises)
 

    this.addText(ctx, {
      font: '10px Roboto',
      fill: 'white',
      text: date,
      x: 222, y: 232-anchorLength,
    });

    this.addReviews(this.state.txtArray, ctx);

    await this.loadImage({
      src: companyLogo, x: 235, y: 285,
      width: 65, height: 15,
      canvas: canvas
    });

    await Promise.all(imageLoadingPromises);

    /*  For saving Image To local phone directory */

    await canvas.toDataURL('image/jpeg', 1.0)
        .then((data) => {
            data = data.substring(1);
            data = data.slice(0, -1);

            if (data.indexOf('data:image/jpeg;base64,') > -1) {
                // Removing "data:image/jpeg;base64," for saving into file as base64 data
                data = data.substring(23);
          }

        RNFetchBlob.fs.writeFile("/storage/emulated/0/Download/canvas"+new Date()+".png", data, 'base64')
            .then((data) => {
                alert("Image Saved")
        })
    })
  }

  ratingCompleted(rating) {
    this.setState({givenRatings:rating})
  }


  loadImage = async function(options) {
    return new Promise((resolve, reject) => {
      const ctx = options.canvas.getContext('2d');
      ctx.fillStyle = 'transparrent';
      const image = new CanvasImage(options.canvas);
      image.crossOrigin = "Anonymous";
      image.src = options.src;
      image.addEventListener('load', () => {
        image.crossOrigin = 'anonymous';
        options.squareImage && this.getSquareDimensions(image, options);

        if (options.clip) {
          ctx.save()
          ctx.beginPath();
          ctx.lineWidth = 1;
          ctx.strokeStyle = "#00CDBE";
          ctx.stroke();
          ctx.arc(35, 250-options.anchorLength, 20,0,2*Math.PI);
          ctx.closePath();
          ctx.clip();
        }
        options.squareImage && ctx.drawImage(image, options.sx, options.sy, options.swidth, options.sheight, options.x, options.y, options.width, options.height);
        !options.squareImage && ctx.drawImage(image, options.x, options.y, options.width, options.height);
        ctx.restore();
        if (options.clip) {
          ctx.lineWidth = 1;
          ctx.strokeStyle = "#00CDBE";
          ctx.stroke();
          ctx.arc(35, 250-options.anchorLength, 20,0,2*Math.PI);
        }
        resolve();
      });
    });
  }

  getSquareDimensions = function(image, options) {
    options.swidth = image.width;
    options.sheight = image.width;
    let diff = (image.width - image.height) / 2;
    diff = diff < 0 ? diff * -1 : diff;
    options.sx = 0;
    options.sy = diff;
    if (image.width > image.height) {
      options.swidth = image.height;
      options.sheight = image.height;
      options.sy = 0;
      options.sx = diff;
    }
 }
  addText = function(ctx, options) {
    ctx.font = options.font;
    ctx.fillStyle = options.fill;
    ctx.fillText(options.text, options.x, options.y);
  }
  renderMealImage(){
    return(
      <View style={styles.imageBlock}>
				<Image source={{uri: this.state.bgImageSrc }} resizeMode="cover" style={styles.bannerImage} />
			</View>
    )
  }
  renderProfileImage(){
     return (
       <View style={styles.imageBlock}>
 				<Image source={{uri: this.state.profileImage }} resizeMode="cover" style={styles.bannerImage} />
 			</View>
     )
  }

  render() {
    return (
      <View style={styles.container}>

      {
      this.state.showImage?

      <Canvas ref={this.handleCanvas}/>
     :
     <ScrollView style={styles.scrollableSection}>
      <View style={styles.contents}>
        <TextInput
        placeholder={"Food Name"}
        value={this.state.foodName}
          style={styles.input}
        onChangeText={(text) =>this.setState({foodName:text})}
        underlineColorAndroid="#000000"
        />
        <TextInput
        placeholder={"Resturant Address"}
        value={this.state.resturantAddress}
        style={styles.input}
        onChangeText={(text) =>this.setState({resturantAddress:text})}
        underlineColorAndroid="#000000"
        />
        <TextInput
        placeholder={"User Review"}
        value={this.state.userReview}
        style={styles.input}
        onChangeText={(text) =>this.setState({userReview:text})}
        underlineColorAndroid="#000000"
        />
        <Rating
        type="star"
        ratingCount={5}
        fractions={0}
        startingValue={0}
        imageSize={30}
        ratingTextColor="#00cdbe"
        ratingBackgroundColor="#00cdbe"
        onFinishRating={this.ratingCompleted}
        showRating
        style={styles.starContainer}
        />
        <View style={styles.imageUploadArea}>
          <View style={styles.bannerPlaceholder}>
            <Image
              style={styles.placeholderImage}
              resizeMode="cover"
              />
          </View>
          <TouchableOpacity onPress={()=>{
            this._pickImage()
            this.setState({imageSelect:1})
          }}
          style={this.state.bgImageSrc!="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-XVlVmRd4QrtD2DMzeDBVpkR-QSev-6Cm_FMivWKmFBosnByK"?null:styles.buttonBannerUpload}>
          {
            this.state.bgImageSrc!="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-XVlVmRd4QrtD2DMzeDBVpkR-QSev-6Cm_FMivWKmFBosnByK"?
            null
            :
            <Text style={styles.link}>Meal Image</Text>
          }
          </TouchableOpacity>

          <View style={styles.bannerImageContainer}>
            <ScrollView horizontal={true} style={styles.bannerImageScroller}>
                {this.renderMealImage()}
            </ScrollView>
          </View>

        </View>
        <View style={styles.imageUploadArea}>
          <View style={styles.bannerPlaceholder}>
            <Image
              style={styles.placeholderImage}
              resizeMode="cover"
              />
          </View>
          <TouchableOpacity onPress={()=>{
            this._pickImage()
            this.setState({imageSelect:2})
          }}
          style={this.state.profileImage!="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-XVlVmRd4QrtD2DMzeDBVpkR-QSev-6Cm_FMivWKmFBosnByK"?null:styles.buttonBannerUpload}>
          {
            this.state.profileImage!="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-XVlVmRd4QrtD2DMzeDBVpkR-QSev-6Cm_FMivWKmFBosnByK"?
            null
            :
            <Text style={styles.link}>Profile Image</Text>
          }
          </TouchableOpacity>

          <View style={styles.bannerImageContainer}>
            <ScrollView horizontal={true} style={styles.bannerImageScroller}>
                {this.renderProfileImage()}
            </ScrollView>
          </View>

        </View>


        <TouchableOpacity onPress={()=>this.setState({showImage:true})} style={styles.button}>
            <Text style={styles.buttonText} >Submit</Text>
        </TouchableOpacity>

        </View>
      </ScrollView>

    }

      </View>
    )
  }
}
